long_desc.thetext:
Sorry for the big description, but I was unable to create a simple reproduction 8-(

Summary:
Eclipse 4.4 and 4.4.1(rc3) both exhibit the following odd problem: when a workspace's projects are newly imported, or when a "clean (all) projects" operation is done I get two similar errors in my project:

Type mismatch: cannot convert from Class<ContractantTypeLister> to Class<? extends IComboDataSet<?>>

But: the errors /disappear/ if I comment the line, save the file, then uncomment again and save again. So the /incremental/ compile does compile the code, but a full compile does not.
The code compiles correctly with Javac and with Kepler and Juno's compilers.

Details:
The failing construct is:

@MetaCombo(dataSet = ContractantTypeLister.class, properties = {
	@MetaComboProperty(name = "description")
})
public ContractantType getContractantType() {

------------------

The relevant part of the MetaCombo annotation looks like:
@Target({ElementType.TYPE, ElementType.METHOD})
@Retention(RetentionPolicy.RUNTIME)
public @interface MetaCombo {
	Class< ? extends IComboDataSet< ? >> dataSet() default UndefinedComboDataSet.class;

------------------

That "default" there assigns the same kind of class as the later failed one, yet it does not fail.

The "ContractantTypeLister" class is defined as:
public class ContractantTypeLister implements IComboDataSet<ContractantType> {
	@Override
	public @Nonnull List<ContractantType> getComboDataSet(@Nonnull UrlPage cc) throws Exception {
		return DaoContractantTypes.getAll(cc.getSharedContext());
	}
}

The annotation AND the IComboDataSet interface are defined in the same project. The failing class is in another. A "clean" on the project with the error will also reproduce the error.
